function App() {
  const creators = [
    {
      name: 'John Doe',
      image: 'path_to_john_image.jpg',
      description: 'John is a software engineer with over 10 years of experience...',
      buttonText: 'More about John'
    },
    {
      name: 'Jane Smith',
      image: 'path_to_jane_image.jpg',
      description: 'Jane is a UI/UX designer passionate about creating intuitive interfaces...',
      buttonText: 'More about Jane'
    },
    // ... Add more creators as needed
  ];

  return (
    <div className="App">
      <About creators={creators} />
    </div>
  );
}

export default App;
